import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../styles/styles.css'; // Import the CSS file
import NavBar from '../components/NavBar'; // Import the Header component

const LoginForm = ({ onSubmit }) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        onSubmit(email, password);
    };

    return (
        <div className="form-container">
            <h2>Login</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="email">Email</label>
                    <input
                        type="email"
                        id="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder="Enter your email"
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="password">Password</label>
                    <input
                        type="password"
                        id="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder="Enter your password"
                        required
                    />
                </div>
                <button type="submit" className="cta-button primary">Login</button>
            </form>
        </div>
    );
};

const RegisterForm = ({ onSubmit }) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        if (password !== confirmPassword) {
            alert("Passwords do not match!");
            return;
        }
        onSubmit(email, password);
    };

    return (
        <div className="form-container">
            <h2>Register</h2>
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <label htmlFor="email">Email</label>
                    <input
                        type="email"
                        id="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder="Enter your email"
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="password">Password</label>
                    <input
                        type="password"
                        id="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder="Enter your password"
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="confirm-password">Confirm Password</label>
                    <input
                        type="password"
                        id="confirm-password"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}
                        placeholder="Confirm your password"
                        required
                    />
                </div>
                <button type="submit" className="cta-button primary">Register</button>
            </form>
        </div>
    );
};

const BasePage = () => {
    const [showForm, setShowForm] = useState(null); // null, "login", or "register"

    const handleLoginSubmit = (email, password) => {
        console.log('Logging in with:', email, password);
    };

    const handleRegisterSubmit = (email, password) => {
        console.log('Registering with:', email, password);
    };

    return (
        <div className="container">
            {/*<NavBar/>*/}
            <div className="hero-section">
                <h1 className="hero-heading">Welcome to My Products Manager Project</h1>
            </div>

            {/* Call-to-Action Buttons */}
            {showForm === null && (
                <div className="cta-buttons">
                    <button
                        className="cta-button primary"
                        onClick={() => setShowForm("login")}
                    >
                        Login
                    </button>
                    <button
                        className="cta-button secondary"
                        onClick={() => setShowForm("register")}
                    >
                        Register
                    </button>
                </div>
            )}

            {/* Dynamically show the form based on the state */}
            {showForm === "login" && <LoginForm onSubmit={handleLoginSubmit} />}
            {showForm === "register" && <RegisterForm onSubmit={handleRegisterSubmit} />}
        </div>
    );
};

export default BasePage;
